import React from "react";

function Heading(){
    return console.log("Calculator;");
}
function add(a,b){
  return a+b;
}
function sub(a,b){
    return a-b;
}
function mult(a,b){
    return a*b;
}
function divis(a,b){
    return a/b;
}

export default Heading;

export {add,sub,mult,divis};
